import React from "react";
import Navbar from "./shared/components/Navbar/Navbar";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Home from './components/pages/shared/Home';
import About from './components/pages/shared/About';
import Login from "./components/pages/shared/Login";
import SignUp from "./components/pages/shared/SignUp";
import ForgotPassword from "./components/pages/shared/ForgotPassword";
import Error404 from "./components/pages/shared/Error404";

import Footer from "./components/shared/Footer";


export default function App() {
  return (
      <>
        <Router>
          <Navbar/>
          <Switch>
            <Route path='/' exact component={Home} />
            <Route path='/home' exact component={Home} />
            <Route path='/login' component={Login} />
            <Route path='/sign-up' component={SignUp} />
            <Route path='/forgot-password' component={ForgotPassword} />
            <Route path='/about' exact component={About} />

            <Route path='/error404' exact component={Error404} />
          </Switch>
        </Router>
        <Footer/>
      </>
  )
};
